--
-- Create procedure `Proc_GetMaterialFilterPaging`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_GetMaterialFilterPaging (IN PageNumber int, IN PageSize int, IN Filter varchar(255), OUT TotalPage int, OUT TotalRecord int)
BEGIN
  #Khởi tạo các biến PageOffset
  DECLARE PageOffset int;
  #Khởi tạo câu lệnh SQL
  DECLARE sqlCommand varchar(1000);

  #Tính toán biến PageOffset
  SET PageOffset = (PageNumber - 1) * PageSize;

  SET @Filter = (SELECT
      Filter);
  IF @Filter IS NOT NULL THEN
    SET @sqlCommand = CONCAT("CREATE TEMPORARY TABLE IF NOT EXISTS filteredData SELECT * FROM view_material vm WHERE ", @Filter, " ORDER BY vm.CreatedDate DESC");
  ELSE
    SET @sqlCommand = 'CREATE TEMPORARY TABLE IF NOT EXISTS filteredData SELECT * FROM view_material vm ORDER BY vm.CreatedDate DESC';
  END IF;

  #Trả về câu lệnh SQL
  PREPARE sqlCommand FROM @sqlCommand;
  EXECUTE sqlCommand;

  CREATE TEMPORARY TABLE IF NOT EXISTS tbData AS
  #Offset: limit row per page
  SELECT
    *
  FROM filteredData LIMIT PageSize OFFSET PageOffset;
  #Tổng số bản ghi
  SET TotalRecord = (SELECT
      COUNT(*)
    FROM filteredData);
  #Tổng số trang
  SET TotalPage = CEIL(TotalRecord / PageSize);
  SELECT
    *
  FROM tbData d;
END
$$

